import React from 'react';
// import { NavLink } from 'react-router-dom';
import Style from '../components/styles/Card.module.css';

export default function Card({ name, image, diets, ID }) {
    return (
        <div className={Style.contenedor} >
            <div className={`${Style.card} ${Style.uClearfix}`} >
                <div className={Style.cardBody} >
                    <h2 className={Style.title} >{name}</h2>
                  
                    <h5 className={`${Style.cardDescription} ${Style.subtle}`} >Diet type: {diets && diets.length ? diets : 'N/A'}</h5>
                    <div >
                   
                    </div>
                </div>
                <img src={image} alt="not found" width="300px" height="300px" className={Style.cardMedia}/>
            </div>
            <div> className={Style.cardShadow}</div>
        </div>
    )
}
